import React from 'react';
import { AppBar, Toolbar, Typography, Box } from '@mui/material';

const Header = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: 'black' }}>
      <Toolbar sx={{ display: 'flex', justifyContent: 'space-between', width: '100%' }}>
        <Typography variant="h6" component="div" sx={{ color: 'white' }}>
          Life is _____________
        </Typography>
        <Box sx={{ flex: 1, backgroundColor: 'white', padding: '10px', color: 'black' }}>
          <Typography variant="body1">
            Life is a magnificent journey filled with unpredictable twists and turns, where each moment holds the potential for growth, love, laughter, and learning. It is a mosaic of experiences, ranging from the mundane to the extraordinary, shaping our perceptions, beliefs, and aspirations. Life is a canvas upon which we paint our dreams, fears, and desires, navigating through challenges with resilience and determination. It is a precious gift bestowed upon us, urging us to cherish every breath, embrace every opportunity, and cultivate meaningful connections with others. Life is a symphony of emotions, echoing the melodies of joy, sorrow, hope, and resilience, guiding us towards self-discovery and fulfillment.
          </Typography>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
